  const dispatch = useAppDispatch();
  useEffect(() => {
    console.log('invoke getProjectsAsync');
    dispatch(getProjectsAsync);
  });

  const handleClick = useCallback(() => {
    console.log('Clicked!');
  }, []);
  return (
    <div className="App">
      <Menu />
      <Project />
    </div>
  );
}
